import Head from "next/head";

const Result = (props) => {
  const { result } = props;

  return (
    <>
      <Head>
        <title>Result</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div>{result}</div>
    </>
  );
};
export default Result;
